INSERT INTO `cms_auslandsAngeboteInhalt` (`id`, `studiengang`, `uniTitel`, `model`, `allgemeineInfos`, `faq`, `erfahrungsbericht`, `maps`) VALUES
(1, 'Wirtschaftsinformatik', 'Abertay University of Dundee (Schottland)', 'schottland', 'Die Universität Abertay Dundee ist mit ca. 5000 Studenten die kleinste Universität in Dundee, Schottland. Die Universität besteht aus insgesamt fünf Fakultäten. Sie ist im Zentrum der Hafenstadt Dundee gelegen und ihre Gebäude gehören zu den modernsten Universitätsgebäuden im UK. Bekannt ist Abertay vor allem für den Bereich Informatik. Sie war weltweit die erste Universität die 1997 einen Studiengang in Computer Games angeboten hat.\n\nInteresse? Schnell registrieren und bewerben!', '<b>Wie lange dauert das Auslandssemster in Abertay?</b><br>Die Semesterlänge lässt sich ungefähr mit der einer normalen deutschen Universität vergleichen. In der Regel sind es zwischen 4,5 und 5 Monaten.<br><b>In welcher Sprache werden die Vorlesungen gehalten?</b><br>Alle Vorlesungen werden in Englisch gehalten. Natürlich ist der schottische Akzent bei dem einen oder anderen Dozenten nicht zu überhören.<br><b>Wie hoch fallen die Studiengebühren aus?</b><br>Die Studiengebühren belaufen sich auf etwa 1000 brit. Pfund.<br><b>Wo wohnt man in Abertay?</b><br>Für die Unterbringung der Studierenden steht ein Studentenwohnheim zur Verfügung.<br>', '<i>Eine tolle Erfahrung, die mich sowohl fachlich, als auch menschlich sehr bereichert hat. Ich kann jedem Studierenden nahelegen, den Sprung ins Unbekannte zu wagen. Die Kultur, Menschen und auch Lehrinhalte waren klasse. <br> Im Gegensatz zu Lehreinheiten an der DHBW waren in Dundee viele Projekte, die eigenständig bearbeitet werden mussten,\r\n in Kombination zu klassischen Klausuren. So erhielt ich einen anderen Bezug zum Stoff und konnte viel lernen.</i><br> <br>\r\nNils Greßler, Jahrgang 2014', 'https://www.google.com/maps/embed/v1/place?key=AIzaSyA76FO67-tqO0XWItx9KtXDgcta9mYHjrM&q=Abertay,Dundee+UK'),
(2, 'Wirtschaftsinformatik', 'American University in Bulgaria (Bulgarien)', 'bulgarien', 'Gegründet wurde die Universität im Jahr 1991. Sie hat etwa 1072 Studenten aus 26 vor allem osteuropäischen Staaten. Die Lehrsprache ist Englisch. \r\nDie Universität sieht ihre Aufgabe darin, „zukünftige Führungskräfte auszubilden, die in die Werte einer offenen, demokratischen Gesellschaft eingeweiht werden und der Gemeinschaft auf diesem Wege dienen.“\r\n\r\nDer an dieser Universität mögliche Abschluss des Bachelors wird in Bulgarien und den Vereinigten Staaten von Amerika anerkannt. Es gibt 74 Fakultätsmitglieder, von denen etwa die Hälfte Amerikaner sind.\r\n\r\nDie Universität orientiert sich stark am amerikanischen Campusleben, jeder der dafür nicht auf die andere Seite des großen Teichs möchte, hat hier die Möglich den American Way of Life in Europa kennen zu lernen.', '', '', 'https://www.google.com/maps/embed/v1/place?key=AIzaSyA76FO67-tqO0XWItx9KtXDgcta9mYHjrM&q=American+University+Bulgaria,Bulgaria'),
(3, 'Wirtschaftsinformatik', 'California State University San Marcos (USA)', 'usasm', 'Die California State University ist das größte staatliche Hochschulnetzwerk des Bundesstaats Kalifornien mit insgesamt 400.000 Studierenden an 23 Standorten. Einer davon ist der 1989 gegründete Campus in San Marcos mit insgesamt ca. 9000 Studierenden in drei Fakultäten. Die Stadt San Marcos liegt im San Diego County und hat ca. 80.000 Einwohner. Der Standort Karlsruhe koordiniert den Austausch für alle DHBW-Standorte.\n\nInteresse? Schnell registrieren und bewerben!', '<b>Wie lange dauert das Auslandssemester an der CSUSM?</b><br>Die Semesterlänge lässt sich ungefähr mit der einer normalen deutschen Universität vergleichen. In der Regel sind es zwischen 4,5 und 5 Monaten.<br><b>Wird für das Auslandssemester an der CSUSM ein Visum benötigt?</b><br>Ja, es wird ein J1-Visum benötigt, welches beim amerikanischen Konsulat rechtzeitig beantragt werden muss. Alle weiteren Informationen rund um das Visum, finden Sie auf folgender Homepage http://travel.state.gov/content/visas/english/study-exchange/exchange.html .<br><b>Wie hoch fallen die Studiengebühren aus?</b><br>Für Studiengebühren muss mit ca. $4.500 gerechnet werden.<br><b>Welche Möglichkeiten zur Unterbringung während des Auslandssemesters werden geboten?</b><br>Für die Unterbringung stehen zwei Studentenwohnheime zur Verfügung, für die man sich gesondert bewerben muss. Weiter besteht die Möglichkeit bei einer Gastfamilie zu hausen. Auch kann eine eigene Unterkunft gefunden werden. Die einzelnen Informationen zur Unterkunft lassen sich auf folgender Webseite einsehen https://www.csusm.edu/global/intstudents/housing.html<br>', '<br><i>Eine prägende Erfahrung, die ich jedem Studierenden nahelegen kann. Eine der besten Entscheidungen meines Lebens.</i> <br> <br> Nicolas Dunke, Jahrgang 2014.', 'https://www.google.com/maps/embed/v1/place?key=AIzaSyA76FO67-tqO0XWItx9KtXDgcta9mYHjrM&q=CSUSM,SanMarcos+USA'),
(4, 'Wirtschaftsingenieurwesen', 'California State University Channel Islands (USA)', 'usaci', 'Die California State University, Long Beach ist eine staatliche Universität in Long Beach (Los Angeles) im US-Bundesstaat Kalifornien.\r\nMit knapp 35.000 Studenten ist sie eine der größten und angesehensten\r\nHochschulen des California-State- University-Systems. Die Universität wurde\r\n1949 gegründet.', '', '<br><i></i>', 'https://www.google.com/maps/embed/v1/place?key=AIzaSyA76FO67-tqO0XWItx9KtXDgcta9mYHjrM&q=CSU,LongBeach+USA'),
(5, 'Wirtschaftsinformatik', 'Costa Rica Institute of Technology (Costa Rica)', 'costarica', 'Das Instituto Tecnológico de Costa Rica ist eine staatliche Universität, spezialisiert auf Ingenieurs- und Naturwissenschaften liegt in Cartago, 22km östlich von der Hauptstadt San José auf etwa 1432m. Die Stadt mit ca. 150000 Einwohnern liegt am Fuße des Vulkans Irazú. Die Universität hat etwa 9000 Studierende, verteilt auf den Hauptcampus und weitere Standorte in Santa Clara,San Carlos, San José, Alajuela und Limon. Die Lehrsprache ist Spanisch.', '', '', 'https://www.google.com/maps/embed/v1/place?key=AIzaSyA76FO67-tqO0XWItx9KtXDgcta9mYHjrM&q=TEC,Cartago,20Costa%20Rica'),
(6, 'Wirtschaftsinformatik', 'Durban University of Technology (Suedafrika)', 'suedafrika', 'Die Technische Universität Durban, kurz DUT, ist eine technische Universität \r\nin Durban, KwaZulu-Natal, Südafrika. Sie wurde 2002 durch die Zusammenlegung mit den Institutionen Technikon Natal und ML Sultan Technikon gegründet, vorher war sie als Durban Institute of Technology bekannt. 2010 waren etwa 25.237 Studierende eingeschrieben. Die Lehrsprache ist Englisch.\r\n\r\nDurban liegt an der Ostküste von Südafrika in der Nähe der Drakenberge. 2010 fanden hier einige Spiele für die Fußballweltmeisterschaft statt. Sie ist eine Großstadt mit 595.000 Einwohnern. Die durchschnittliche Wassertemperatur beträgt 22 Grad.', '', '', 'https://www.google.com/maps/embed/v1/place?key=AIzaSyA76FO67-tqO0XWItx9KtXDgcta9mYHjrM&q=Durban+Technical+University,South+Africa'),
(7, 'Wirtschaftsinformatik', 'South-Eastern Finland University of Applied Sciences (Finnland)', 'finnland', 'Die South-Eastern Finland University of Applied Sciences (Xamk) ist eine 2017 Universität in der finnischen Stadt Mikkeli. Sie wird aktuell von ca. 9300 Studierenden besucht und ist die größte Universität in Finnland im Bereich Forschung und Entwicklung. Die Lehrsprache ist Englisch.\r\n\r\nMikkeli ist eine Kleinstadt mit 54000 Einwohnern und liegt an der Savilahti-Bucht, ca. 230km von der Hauptstadt Helsinki\r\nentfernt.', '', '', 'https://www.google.com/maps/embed/v1/place?key=AIzaSyA76FO67-tqO0XWItx9KtXDgcta9mYHjrM&q=Xamk+Mikkeli,Finland'),
(8, 'Wirtschaftsingenieurwesen', 'Technischen Universität Lodz (Polen)', 'polen', 'Die technische Universität wurde 1945 mit rund 500 Studierenden gegründet. Heute studieren ca. 20.000 an der Hochschule. Im Rahmen der Internationalisierung hat sich die Universität mit einer „International Faculty of Engineering“ (IFE) hervorgetan. Hier kann in englischer und französischer Sprache studiert werden.', '', '<i>Die Betreuung ist in Lodz größtenteils durch ein MentorSystem\r\ngeregelt... Die meisten Mentoren, die ich kennengelernt\r\nhabe, sind sehr freundlich, aufgeschlossen und hilfsbereit. <br>\r\nMein Mentor hat mich beispielsweise am Busbahnhof abgeholt und sich den Tag und den darauf folgenden frei genommen, um mir alles zu zeigen.<br><br> </i> Thomas Charchurski, Jahrgang 2011', 'https://www.google.com/maps/embed/v1/place?key=AIzaSyA76FO67-tqO0XWItx9KtXDgcta9mYHjrM&q=Uni,Lodz+Polen'),
(9, 'Wirtschaftsinformatik', 'Standard', 'standard', 'Allgemein', 'Faq', 'Erfahrung', '');

