INSERT INTO `cms_erfahrungsBerichte` (`ID`, `bild`, `text`, `matrikelnummer`, `sterne`, `frage`) VALUES
(1, , '\"Hallo, mein Name ist Valentin H. und ich habe im Rahmen meines Wirtschaftsinformatik Studiums an der DHBW Karlsruhe ein Auslandssemester vom Januar bis Mai 2014 an der California State University San Marcos (CSUSM) absolviert. Ich bin sehr froh darüber, dass für mich die Möglichkeit bestand, an solch einer Erfahrung mit tollen Erlebnissen teilhaben konnte. Ich emfehle es jedem, diese vielleicht einmalige Chance in seinem Leben zu nutzen um ein anderes, fremdes Universitätsleben in einem fernen Land kennen zu lernen. Wenn Ihr mehr über meinen oder den Aufenthalt anderer Kommilitonen erfahren wollt, dann meldet euch an und \"stöbert\" in den unterschiedlichen Erfahrungsberichten und entscheidet Euch an einem solchen Programm teilhaben zu können.\"', 0, 0, '');

