--
-- Daten für Tabelle `faq`
--

INSERT INTO `faq` (`faqID`, `frage`, `anwort`, `artFaq`) VALUES
(1, '<b>Wer darf sich für ein Auslandsstudium bewerben?</b>', 'Grundsätzlich ist für alle Studierenden der DHBW Karlsruhe ein Auslandssemester an einer der Partneruniversitäten der DHBW möglich. Notwendig dazu sind die Zustimmung der Ausbildungsfirma und die Zustimmung des Studiengangsleiters.', ''),
(2, '<b>In welchem Studiensemester sollte ich mich für ein Auslandsaufenthalt bewerben?</b>', 'Das Studium an der Dualen Hochschule ist kurz. Die Planung eines Auslandsaufenthalts nimmt jedoch viel Zeit in Anspruch. Es ist also wichtig, den Auslandsaufenthalt möglichst früh zu planen – schon im 1. Semester sollte man wissen, wohin die Reise gehen soll und das Unternehmen sollte um Zustimmung gebeten werden.', ''),
(3, '<b>In welchem Studiensemester sollte das Auslandssemester vollzogen werden?</b>', 'Das Auslandssemester sollte idealerweise im 4. Semester absolviert werden. Der Zeitraum, in dem die Vorlesungen, Seminare und Prüfungen an der ausländischen Hochschule stattfinden, stimmt in der Regel nicht vollständig mit der Theoriephase an der DHBW überein. In der Regel dauert das Theoriesemester an der ausländischen Hochschule – wie auch an den deutschen Universitäten – länger. Das heißt, das Auslandssemester reicht in der Regel in die Praxisphase hinein und die DHBW-Studierenden müssen sich mit ihren Ausbildungsunternehmen auch in Bezug auf die Semesterzeiten abstimmen.', ''),
(4, '<b>Wie viel würde ein Auslandssemester kosten?</b>', 'Die Kosten für ein Auslandssemester variieren stark vom jeweiligen Standort der Partneruniversität. Genauere Informationen zu den Kosten entnehmen Sie bitte dem Dokument <a href= \"https://www.dhbw-karlsruhe.de/fileadmin/user_upload/dokumente/Auslandsamt/Infobrochuere/InfobroschuereAusland2014_QuadratFinal_Druck_29.01.13.pdf\">„mitDerWeltImAustausch.pdf“</a>.', ''),
(5, '<b>Besteht die Möglichkeit, finanzielle Hilfe zu beantragen?</b>', 'Zur finanziellen Unterstützung des Auslandsaufenthaltes kann die Beantragung eines Sokrates/Erasmus-Stipendiums im Auslandsamt (Höhe ca. 200 Euro monatlich) oder eines Stipendiums der Landesstiftung Baden-Württemberg (Höhe ca. 100-300 Euro monatlich) beantragt werden. Weitere Details zu Finanzierungsmöglichkeiten können im Dokument <a href=\"https://www.dhbw-karlsruhe.de/fileadmin/user_upload/dokumente/Auslandsamt/Infobrochuere/InfobroschuereAusland2014_QuadratFinal_Druck_29.01.13.pdf\">„mitDerWeltImAustausch.pdf“<a/> eingesehen werden. Des Weiteren bieten viele Partnerunternehmen ihren Studierenden weitere Finanzierungsmöglichkeiten an.', ''),
(6, '<b>Welche Partneruniversitäten stehen zur Verfügung?</b>', 'Wir bieten zahlreiche Universitäten in den unterschiedlichsten Ecken der Welt. Das Angebot erstreckt sich von Australien bis USA. Alle Angebote sind in dem Dokument <a href=\"https://www.dhbw-karlsruhe.de/fileadmin/user_upload/dokumente/Auslandsamt/Infobrochuere/InfobroschuereAusland2014_QuadratFinal_Druck_29.01.13.pdf\">„mitDerWeltImAustausch.pdf“<a/>  aufgelistet.', '');

